import React from 'react'
import auth0 from '../lib/auth0'
import MensalidadeResumo from '../Components/MensalidadesResumo'

const Index = async (props) => {
  return (
    <div>
      <h3>Mensalidades</h3>
      <p>Resumo das Mensalidades</p>
      <p>Total no Mês atual: {await MensalidadeResumo()} </p>
      <h3>Vendas</h3>
      <p>Resumo das vendas</p>
      <h3>Compras</h3>
      <p>Resumo das compras</p>
      <h3>Despesas</h3>
      <p>Resumo das despesas</p>
    </div>
  )
}

export default Index

export async function getServerSideProps({ req, res }) {
  const session = await auth0.getSession(req)
  console.log('SSR from index')
  if (session) {
    return {
      props: {
        user: session.user
      }
    }
  }
  return {
    props: {
      user: 'Usuário não logado'
    }
  }
}
